DROP DATABASE pipemodel;

CREATE DATABASE pipemodel;


CREATE TABLE IF NOT EXISTS misaligned
(m_id INT UNSIGNED AUTO_INCREMENT,
m_location VARCHAR(20) NOT NULL,
m_time VARCHAR(32) NOT NULL,
m_misaXLeft VARCHAR(16) NOT NULL,
m_misaXRight VARCHAR(16) NOT NULL,
m_misaYLeft VARCHAR(16) NOT NULL,
m_misaYMiddle VARCHAR(16) NOT NULL,
m_misaYRight VARCHAR(16) NOT NULL,
m_misaZ VARCHAR(16) NOT NULL,
PRIMARY KEY (m_id)
)ENGINE=INNODB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS evaluationLevel
(e_id INT UNSIGNED AUTO_INCREMENT,
e_misa VARCHAR(16) NOT NULL,
e_misaClass VARCHAR(16) NOT NULL,
PRIMARY KEY (e_id)
)ENGINE=INNODB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS pipeline
(p_id INT UNSIGNED AUTO_INCREMENT,
p_pipeNum VARCHAR(16) NOT NULL,
p_time VARCHAR(32) NOT NULL,
p_minXLeft VARCHAR(16) NOT NULL,
p_maxXLeft VARCHAR(16) NOT NULL,
p_avgXLeft VARCHAR(16) NOT NULL,
p_varXLeft VARCHAR(16) NOT NULL,

p_minXRight VARCHAR(16) NOT NULL,
p_maxXRight VARCHAR(16) NOT NULL,
p_avgXRight VARCHAR(16) NOT NULL,
p_varXRight VARCHAR(16) NOT NULL,

p_minYLeft VARCHAR(16) NOT NULL,
p_maxYLeft VARCHAR(16) NOT NULL,
p_avgYLeft VARCHAR(16) NOT NULL,
p_varYLeft VARCHAR(16) NOT NULL,

p_minYMiddle VARCHAR(16) NOT NULL,
p_maxYMiddle VARCHAR(16) NOT NULL,
p_avgYMiddle VARCHAR(16) NOT NULL,
p_varYMiddle VARCHAR(16) NOT NULL,

p_minYRight VARCHAR(16) NOT NULL,
p_maxYRight VARCHAR(16) NOT NULL,
p_avgYRight VARCHAR(16) NOT NULL,
p_varYRight VARCHAR(16) NOT NULL,

p_misa VARCHAR(16) NOT NULL,
e_id INT UNSIGNED NOT NULL,

p_remarks VARCHAR(64),

PRIMARY KEY (p_id),
FOREIGN KEY(e_id) REFERENCES evaluationLevel(e_id)
)ENGINE=INNODB DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS pipepart
(p_id INT UNSIGNED AUTO_INCREMENT,
p_location VARCHAR(32) NOT NULL,
p_misaX VARCHAR(16) NOT NULL,
p_misaY VARCHAR(16) NOT NULL,
p_misaZ VARCHAR(16) NOT NULL,
e_id INT UNSIGNED NOT NULL,
PRIMARY KEY (p_id),
FOREIGN KEY(e_id) REFERENCES evaluationLevel(e_id)
)ENGINE=INNODB DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS allPipeMisa
(a_id INT UNSIGNED AUTO_INCREMENT,
a_location VARCHAR(32) NOT NULL,
a_misaX VARCHAR(16) NOT NULL,
a_misaY VARCHAR(16) NOT NULL,
e_id INT UNSIGNED NOT NULL,
PRIMARY KEY (a_id),
FOREIGN KEY(e_id) REFERENCES evaluationLevel(e_id)
)ENGINE=INNODB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS historyData
(h_id INT UNSIGNED AUTO_INCREMENT,
h_startTime DATETIME NOT NULL,
h_endTime DATETIME NOT NULL,
h_dataFileName VARCHAR(32) NOT NULL,
h_dataFilePath VARCHAR(128) NOT NULL,
h_dataFileSize VARCHAR(16) NOT NULL,
h_sqlRecordPath VARCHAR(128),
h_reportFileName VARCHAR(32),
h_reportFilePath VARCHAR(128),
h_reportFileSize VARCHAR(16),
PRIMARY KEY (h_id)
)ENGINE=INNODB DEFAULT CHARSET=utf8;


